    Header, 
    Aside, 
    Main, 
    Menu,
    Submenu,
    MenuItemGroup,
    MenuItem,
    Breadcrumb,
    BreadcrumbItem,
    Card,
    Row,
    Col,
    Table,
    TableColumn,
    Tooltip,
    Pagination,
    Dialog,
    Select,
    Option,
    DatePicker,
    MessageBox,
    Dropdown,
    DropdownItem,
    DropdownMenu,
    Tag,
    Upload,
    Autocomplete,
    Notification,
    Slider,
    Steps,
    Step
   } from "element-ui";

Vue.use(Button);
Vue.use(Form);
