Vue.use(Option);
Vue.use(DatePicker);
Vue.use(Dropdown);
Vue.use(DropdownItem);
Vue.use(DropdownMenu);
Vue.use(Tag);
Vue.use(Upload); 
Vue.use(Autocomplete);
Vue.use(Slider);
Vue.use(Steps);
